import React from 'react';
import './PopCardStyles.scss';

const PopCard = ({pop_song}) => {
	const { id, name, song, album, date } = pop_song;
	return (
		<div className='dib br4 pa3 ma2 grow bw2 shadow-5 card-display'>
			<h2>{song}</h2>
			<h3>by {name}</h3>
			<h4>Album/Single: {album}</h4>
			<p>Realease date: {date}</p>
			<button className="box-container">HIT THIS SONG</button>
		</div>
	);
};

export default PopCard;

